import '../css/member.css';
import phop from '../image/phop.png';
import nun from '../image/nun.png';
import nutwat from '../image/nutwat.png';
import tle from '../image/Tle.png';
import ball from '../image/ball.png';
import tui from '../image/tui.png';
function Member() {
    return (
      <div className="Member">
          <div><p className="membertp" > MEMBER</p>
        <p className="memberthtp">- สมาชิก -</p></div>
        <img src={phop} width='400px' className="phop"/>
        <img src={nun} width='400px'className="nun"/>
        <img src={tle} width='400px'className="tle"/>
        <img src={tui} width='400px'className="tui"/>
        <img src={ball} width='400px'className="ball"/>
        <img src={nutwat} width='400px'className="nutwat"/>
          </div>
            );
}

export default Member;
